import React from "react";
import { Row, Col } from "antd";
import Menu from "../Molecules/Menu/Menu";
import Logo from "../Atoms/Logo/Logo"
import "./style.css";
class HomePage extends React.Component {
  state = {
    list: [
    {
      id: 1,
      title: "Cá Nhân",
      icon: "music"
    },
    {
      id: 2,
      title: "Khám Phá",
      icon: "dot-circle"
    },
    {
      id: 3,
      title: "#zingchart",
      icon: "chart-line"
    },
    {
      id: 4,
      title: "Radio",
      icon: "headphones"
    },
    {
      id: 5,
      title: "Theo dõi",
      icon: "list"
    },
    {
      id: 6,
      title: "Nhạc Mới",
      icon: "microphone"
    },
    {
      id: 7,
      title: "Thể Loại",
      icon: "icons"
    },
    {
      id: 8,
      title: "Top 100",
      icon: "star-half-alt"
    },
    {
      id: 9,
      title: "MV",
      icon: "guitar"
    }
    ]
  };
  render() {
    return (
      <>
        <Row>
          <Col className="left-content" span={4}>
            <Logo/>
            <Menu list={this.state.list}/>
          </Col>
          <Col className="right-content" span={20}>
            col-18
          </Col>
        </Row>
      </>
    );
  }
}

export default HomePage;
